(22, 2, 'Increase orders by ~25% and ensure cold-chain capacity to meet rising demand.', 'high', 'Cold brew has the highest search interest (3.25M) and top sales (1.31M), indicating strong, growing demand.', 'openai-gpt5', '2025-10-19 03:27:01', 1),
(23, 3, 'Boost stock by ~15–20% and prioritize milk supply and barista prep during peak hours.', 'high', 'Latte shows high total sales (922K) relative to quantity, signaling strong sales velocity that warrants more stock.', 'openai-gpt5', '2025-10-19 03:27:01', 1),
(24, 1, 'Raise orders modestly (~10%) and monitor daily sell-through for gradual adjustments.', 'medium', 'Americano has strong search interest and steady sales (776K), so a conservative increase will capture sustained demand without overstocking.', 'openai-gpt5', '2025-10-19 03:27:01', 1),
