(27, 6, 'Reduce regular orders by ~15–25%, move to just-in-time restocking, and consider promos to clear slow-moving stock.', 'low', 'Cappuccino shows the lowest search interest and the smallest sales/quantity footprint, indicating lower demand relative to other items.', 'openai-gpt5', '2025-10-19 03:27:01', 1);
